@kasperfogh Hej Kasper
Jag rekommenderar att du kontaktar oss på chat eller telefon  https://t.co/RDEH7uxbwJ så skall vi se på detta. Chatten öppnar 07:00 imorgon igen.
Vänliga hälsningar /Anna

@kieransimpson Hi Kieran 
If you are affected by cancelled flights and your booking is made via an travel agent you can request refund via this form https://t.co/Y7XCcQ5U7a I hope that helps. At the moment we have technical issues with the chat I hope it solves shortly.
Kind regards / Anna

@Bannnxz Hi, sorry to hear that. You can trace your luggage using the PIR-number at: https://t.co/2zwsPbhQFU
You can find contact info for baggage service at: https://t.co/ZV9bTO3uo2
I'd advice you remove your tweet due to it containing sensitive information. Kind regards/Rebecca

@dolls123 Hi @dolls123, the maximum weight that you can bring to the cabin is: 8 kg.
You can read more about it here https://t.co/2s76UNHlEj
Kind regards, Mikael.

@SlettengNora Hej! 

Om du vill skicka in ett klagomål så kan du göra det via denna länk: https://t.co/xMt9zSrqJc Men om du får fram svaret att du behöver kontakta oss via telefon ändå så behöver du dessvärre ringa oss för att vi ska kunna hjälpa dig.

//Vänlig hälsning, Dennis

@PatrikNilsson Hej! 

Jag beklagar om ditt bagage är försenat. Det bästa vi kan rekommendera är att hålla koll på ditt ärende via denna sida: https://t.co/HEz1TwbZCI
Vi kommer meddela dig via sms så fort vi har någon ny information gällande ditt ärende.

//Vänlig hälsning, Dennis

@ChadStaples1 Hi! 

I'm sorry if you had problems using your voucher. The best we can recommend in that case is to contact us via the chat or by phone, so we can have a closer look at the problem for you. 

//Kind regards,
Dennis

@charanya7 Hi, if you have filed the compensation claim already you don't have to do anything more for now. Our Customer Care will contact you on email as soon as they have started to handle your claim.

Best regards,
Anton.

@subalternsurfer Hi, I'm sorry to hear that the rebooking you received is not optimal for your circumstances. If you wish to cancel the reservation and request refund instead you can do so on our website https://t.co/yZoPBVnDMr

Best regards,
Anton.

@deyueJ Hello, in this case I would recommend that you try to contact baggage service support for help with adding the temporary address, you can find their phone numbers at https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@plantin66 Hi, if you need help with delayed or missing baggage please try calling Baggage service Gardermoen +47 64 81 27 00 or try calling +46 771 224 243 (Swedish number) if the first one does not connect you.

Best regards,
Anton.

@slydog95 Hi. we are unfortunately not able to assist with missing baggage errands, please call Baggage service support for the airport who is handling your case https://t.co/ZV9bTO3uo2

Best regards,
Anton.

@EilifT Hi, if you don't wish to contact the travel agency directly to request the refund, please use the web form on our website to request your refund https://t.co/Y7XCcQ5U7a

Best regards,
Anton.

@TThrss Hi, I recommend that you contact us on livechat or phone support with your booking reference if you have not yet received a new alternative outbound journey https://t.co/b3QIqPk7bj as we are not able to assist with individual cases on Twitter.

Best regards,
Anton.

@BMorearty Hi, if you have an open delayed baggage case already please use Worldtracer to track the progress https://t.co/2zwsPbhQFU - If you are experiencing problems with the website please try clearing cache and cookies in your web browser.

Best regards,
Anton.

@AVostanis Hi, our Customer Care department who handle claims currently have a general handling time of 6-8 weeks. They will email you as soon as they have looked into your claim.

Best regards,
Anton.
